import {
  Streamlit,
  StreamlitComponentBase,
  withStreamlitConnection,
} from "streamlit-component-lib"
import React, { ReactNode } from "react"

interface State {
  numClicks: number
  isFocused: boolean
}

/**
 * This is a React-based component template. The `render()` function is called
 * automatically when your component should be re-rendered.
 */
class MyComponent extends StreamlitComponentBase<State> {
  public state = { numClicks: 0, isFocused: false }

  public render = (): ReactNode => {
    // Arguments that are passed to the plugin in Python are accessible
    // via `this.props.args`. Here, we access the "name" arg.
    const agent = this.props.args["agent"]
    const place = this.props.args["place"]
    const kills = this.props.args["kills"]
    const deaths = this.props.args["deaths"]
    const assists = this.props.args["assists"]
    const ally_score = this.props.args["ally_score"]
    const enemy_score = this.props.args["enemy_score"]
    const result = this.props.args["result"]
    const date = this.props.args["date"]
    const map = this.props.args["map"]


    // Streamlit sends us a theme object via props that we can use to ensure
    // that our component has visuals that match the active theme in a
    // streamlit app.
    const { theme } = this.props
    const style: React.CSSProperties = {}

    // Maintain compatibility with older versions of Streamlit that don't send
    // a theme object.
    if (theme) {
      // Use the theme object to style our button border. Alternatively, the
      // theme style is defined in CSS vars.
      const borderStyling = `1px solid ${
        this.state.isFocused ? theme.primaryColor : "gray"
      }`
      style.border = borderStyling
      style.outline = borderStyling
    }

    // MAIN COMPONENT PROGRAM
    return (
      <div className={styles['container']}>
        <div className={styles['match-history-box']}>
          <div className={styles['player-info-box']}>
            <img
              src="https://play.teleporthq.io/static/svg/default-img.svg"
              alt="image"
              className={styles['agent-icon']}
            />
            <div className={styles['kda-box']}>
              <span className={styles['kda-title']}>K / D / A</span>
              <span className={styles['kda-text']}>{kills} / {deaths} / {assists}</span>
            </div>
            <div className={styles['place-box']}>
              <span className={styles['place-text']}>{place}</span>
            </div>
          </div>
          <div className={styles['score-box']}>
            <span className={styles['score']}>
              <span className={styles['text']}>13</span>
              <span className={styles['text1']}> - </span>
              <span className={styles['text2']}>9</span>
              <br></br>
            </span>
            <span className={styles['result']}>
              <span>VICTORY</span>
              <br></br>
            </span>
          </div>
          <div className={styles['match-info-box']}>
            <span className={styles['game-time']}>2023-12-12 24:60:60</span>
            <span className={styles['map']}>
              <span>Fracture</span>
              <br></br>
            </span>
          </div>
        </div>
      </div>
    )
  }
}

// "withStreamlitConnection" is a wrapper function. It bootstraps the
// connection between your component and the Streamlit app, and handles
// passing arguments from Python -> Component.
//
// You don't need to edit withStreamlitConnection (but you're welcome to!).
export default withStreamlitConnection(MyComponent)
